.cucumber-report-header {
  width: 100%;

  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {

}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {

}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {

  }

  }

  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }

.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

idual             |\n      | Joint                  |\n\n# Passing multiple Strings to a input filed ::: StringBuilder + AsLists\n\n  Scenario: Account Name element Verification\n    Given user clicks on \"savings\" dropdown\n    When user select \"new-savings\" option\n    When user should be redirected to Create Savings page\n    Then user should be able to see Account Name Field\n    When user should sends the following details\n      | alphanumeric and special character |\n      | Fahad 123                          |\n      | Kader 45\u0026#@                        |\n      | Esrat Jahan                        |\n      | Sani JAHAN                         |\n      | J\u0026*#hn is Not HA$$Y                |\n\n\n  Scenario Outline: Initial Deposit Amount element verification\n    Given user clicks on \"savings\" dropdown\n    When user select \"new-savings\" option\n    When user should be redirected to Create Savings page\n    Then user should be able to see line Initial Deposit Amount\n    And  user should be able to input \"\u003c1000\u003e\" to be deposited\n    Examples:\n      | 1000 |\n      | 100  |\n      | 200  |\n      | 300  |\n      | 400  |\n      | 500  |\n\n\n  Scenario: Create New Savings Account End to End Verification\n\n    Given user clicks on \"savings\" dropdown\n    When  user select \"new-savings\" option\n    When  user is on Create Savings page\n    Then  user select Savings Account Type\n    And   user select Joint\n    Then  user enter TestName on the Account Name field\n    And   user should be able to input $200 to be deposited\n    When  user clicks on Submit button\n    Then  verify user is redirected to the View Savings Page\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/fahadkader/Desktop/Git/Cucumber/DigitalBank_Cucumber_UI_Framework2/src/test/resources/features/UN4SavingAccount.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Create new
